public class Solution {
    public String[] solution(String[] input) {
        int len = input.length;
        for (int i = 0; i < len - 1; i++) {
            if (input[i].equals("a") && input[i + 1].equals("a")) {
                while (i < len - 1 && input[i].equals("a") && input[i + 1].equals("a")) {
                    i++;
                }
                input[i] = "a";
                input[i + 1] = "g";
            }
        }
        return input;
    }
}
